import './Card.css';
import { useState } from 'react';

const Table = ({ entries }) => {
  // if (entries.length > 0) {
  //   entries[3].map(entry => console.log(entry));
  // }

  return (
    <section>
      <article>
        {entries.length > 0 ? entries[3].map(entry => {
          <div>{entry.position}</div>
        }): null}
      </article>
    </section>
  )
};

export default Table;
